import './ThankYou.css'

const ThankYou = () => {

  return (

    <div className='thank-you-container'>
    <h1>Thank You!</h1>
    <p>Josh will be in touch <strong>soon.</strong></p>
    <a href='/'><button><strong>Return to Home</strong></button></a>
    </div>

  )
}

export default ThankYou
